using System;
using System.Collections.Generic;
using System.Threading;
using System.Threading.Tasks;
using Dapr.Client;
using FluentAssertions;
using MediatR;
using Moq;
using Prism.Picshare.Dapr;
using Prism.Picshare.Services.Pictures.Commands.Admin;
using Xunit;

namespace Prism.Picshare.Services.Pictures.Tests.Commands.Admin;

public class RelaunchUploadHandlerTests
{
    [Fact]
    public async Task Handle_Ok()
    {
        // Arrange
        var jsonByte = Convert.FromBase64String(
            "");
        var daprClient = new Mock<DaprClient>();
        daprClient.Setup(x => x.InvokeBindingAsync(It.IsAny<BindingRequest>(), It.IsAny<CancellationToken>()))
            .ReturnsAsync(new BindingResponse(new BindingRequest(Stores.Data, "list"), jsonByte, new Dictionary<string, string>()));

        // Act
        var handler = new RelaunchUploadHandler(daprClient.Object);
        var result = await handler.Handle(new RelaunchUpload(Guid.NewGuid()), CancellationToken.None);

        // Assert
        result.Should().Be(Unit.Value);
    }
}